values  (3, 2, 3, 'The Best Smart Watch for Your Wrist with Real-Time Notifications for Calls, Emails & More', 'https://storage.googleapis.com/jamma-comments-332612.appspot.com/productmedia/-Mpqgb_8gWBR0vdmNCIs.png', null, 'Huawei GT 2e', 4999, 100, '2023-06-09 09:33:25.124897', null, '2022-12-31 00:00:00.000000', false, false, 0, 'huawei-gt-2e'),
        (4, 1, 2, 'Elite Active 75t have been specifically designed for an active lifestyle. An IP57-rating makes them fully waterproof and sweatproof, so there’s nothing holding you back from running through the storm or sweating out your new personal best in the gym.', 'https://storage.googleapis.com/jamma-comments-332612.appspot.com/productmedia/-MpqgzgJb0g6VI1qPcM-.png', null, 'Jabra Elite Active 75t', 17152, 100, '2023-06-09 09:34:50.198817', null, '2022-12-31 00:00:00.000000', false, false, 0, 'jabra-elite-active-75t'),
        (2, 1, 1, 'True wireless stereo, HIFI sound. Supports Binaural Calls Both the left and right ears have full Bluetooth headset functionality and can be used individually or in pairs. Dual mode Bluetooth 5.0, ultra low power consumption. Bluetooth transmission distance: 10 meters barrier-free. Listening to song time: about 6-8 hours', 'https://storage.googleapis.com/jamma-comments-332612.appspot.com/productmedia/-MpqfiW5cQnJRw2Jkd8B.png', null, 'F9 Pro TWS', 246, 100, '2023-06-09 09:32:48.093253', null, '2022-12-31 00:00:00.000000', false, false, 0, 'f9-pro-tws'),
        (5, 1, 5, 'Open-Ear Bluetooth Bone Conduction Sport Headphones - Sweat Resistant Wireless Earphones for Workouts and Running - Built-in Mic', 'https://storage.googleapis.com/jamma-comments-332612.appspot.com/productmedia/-Mpqi95tZdJeC5Vqt_Y_.png', null, 'Aftershockz Aeropex', 8490, 100, '2023-06-09 09:36:48.967634', null, '2022-12-31 00:00:00.000000', false, false, 0, 'aftershockz-aeropex'),
        (6, 1, 4, 'AirPods Pro have been designed to deliver Active Noise Cancellation for immersive sound, Transparency mode so you can hear your surroundings, and a customizable fit for all-day comfort.', 'https://storage.googleapis.com/jamma-comments-332612.appspot.com/productmedia/-MpqiHyaeDxQQSZ2H8vr.png', null, 'Airpods Pro', 14990, 100, '2023-06-09 09:37:24.121729', null, '2022-12-31 00:00:00.000000', false, false, 0, 'airpods-pro'),
        (7, 1, 6, 'Vista is Jaybird''s first dustproof, shockproof, waterproof, and sweatproof set of true wireless earbuds.', 'https://storage.googleapis.com/jamma-comments-332612.appspot.com/productmedia/-MpquI0nt9-z9WwEYdeF.png', null, 'Jaybird Vista', 3303, 100, '2023-06-09 09:37:55.869881', null, '2022-12-31 00:00:00.000000', false, false, 0, 'jaybird-vista'),
        (8, 1, 7, 'Powerbeats Pro totally wireless earphones will revolutionize the way you work out. With true wireless earbuds, there are no wires to hold you back.', 'https://storage.googleapis.com/jamma-comments-332612.appspot.com/productmedia/-MpqvWQgHHnGvp2SRMfA.png', null, 'Beats Powerbeats Pro', 13490, 100, '2023-06-09 09:38:29.570193', null, '2022-12-31 00:00:00.000000', false, false, 0, 'beats-powerbeats-pro'),
        (9, 2, 4, 'It''s the ultimate device for a healthy life. Apple Watch can do what your other devices can''t because it''s on your wrist. When you wear it, you get a fitness partner that measures all the ways you move, meaningful health insights and a connection to the people and things you care about most.', 'https://storage.googleapis.com/jamma-comments-332612.appspot.com/productmedia/-MpqyChKZH8BAl1dsZyr.png', null, 'Apple Watch Series 6', 19350, 100, '2023-06-09 09:39:08.914952', null, '2022-12-31 00:00:00.000000', false, false, 0, 'apple-watch-series-6'),
        (10, 2, 8, 'Steel HR is a life-friendly hybrid smartwatch that can accompany you to the pool, hit the showers, and survive a downpour.', 'https://storage.googleapis.com/jamma-comments-332612.appspot.com/productmedia/-MpqyTVNFZ1MLr1KbNU7.png', null, 'Withings Steel HR', 13996, 100, '2023-06-09 09:39:46.578812', null, '2022-12-31 00:00:00.000000', false, false, 0, 'withings-steel-hr'),
        (11, 2, 9, 'The Forerunner® 945 is a premium running watch that features music streaming, music storage, performance monitoring features such as VO2 max and much more.', 'https://storage.googleapis.com/jamma-comments-332612.appspot.com/productmedia/-MpqyukIQe2_jjYa5lNe.png', null, 'Garmin Forerunner 945', 23990, 100, '2023-06-09 09:40:27.188969', null, '2022-12-31 00:00:00.000000', false, false, 0, 'garmin-forerunner-945'),
        (13, 5, 1, 'Keep your creativity organized with this stylish and durable pencil pouch.', 'https://snivqgzdabtawqfgptyd.supabase.co/storage/v1/object/public/products/pencil-pouch-2.jpg?t=2023-06-12T10%3A09%3A20.079Z', null, 'Pencil Pouch', 49.99, 50, '2023-06-12 10:17:45.318448', null, '2022-12-31 00:00:00.000000', false, false, 0, 'pencil-pouch'),
        (14, 5, 1, 'Unleash your thoughts with this sleek and smooth black ballpoint pen.', 'https://snivqgzdabtawqfgptyd.supabase.co/storage/v1/object/public/products/blue-bp-pen.jpg', null, 'Black ballpoint pen', 4.99, 100, '2023-06-12 10:17:45.318448', null, '2022-12-31 00:00:00.000000', false, false, 0, 'black-ballpoint-pen'),
        (15, 5, 1, 'Add a touch of inspiration to your writing with this reliable blue ballpoint pen.', 'https://snivqgzdabtawqfgptyd.supabase.co/storage/v1/object/public/products/blue-bp-pen.jpg', null, 'Blue ballpoint pen', 4.99, 100, '2023-06-12 10:17:45.318448', null, '2022-12-31 00:00:00.000000', false, false, 0, 'blue-ballpoint-pen'),
        (16, 5, 1, 'Experience the timeless charm of this classic No.2 pencil, perfect for any creative endeavor.', 'https://snivqgzdabtawqfgptyd.supabase.co/storage/v1/object/public/products/2-pencil.jpg', null, 'No.2 Pencil', 0.99, 200, '2023-06-12 10:17:45.318448', null, '2022-12-31 00:00:00.000000', false, false, 0, 'no.2-pencil'),
        (17, 5, 1, 'Sharpen your ideas to precision with this compact and efficient pencil sharpener.', 'https://snivqgzdabtawqfgptyd.supabase.co/storage/v1/object/public/products/pencil-sharp.jpg', null, 'Pencil Sharpener', 3.99, 50, '2023-06-12 10:17:45.318448', null, '2022-12-31 00:00:00.000000', false, false, 0, 'pencil-sharpener'),
        (18, 5, 1, 'Illuminate your notes and make key information pop with this vibrant set of highlighters.', 'https://snivqgzdabtawqfgptyd.supabase.co/storage/v1/object/public/products/highlighter.jpg?t=2023-06-12T10%3A10%3A30.126Z', null, 'Highlighter set', 7.99, 50, '2023-06-12 10:17:45.318448', null, '2022-12-31 00:00:00.000000', false, false, 0, 'highlighter-set'),
        (19, 5, 1, 'Unleash your inner artist with this set of crayons, offering a world of vibrant colors.', 'https://snivqgzdabtawqfgptyd.supabase.co/storage/v1/object/public/products/marker.jpg', null, 'Crayon', 2.99, 100, '2023-06-12 10:17:45.318448', null, '2022-12-31 00:00:00.000000', false, false, 0, 'crayon'),
        (20, 5, 1, 'Make mistakes vanish like magic with this soft and smudge-free eraser.', 'https://snivqgzdabtawqfgptyd.supabase.co/storage/v1/object/public/products/eraser.jpg?t=2023-06-12T10%3A11%3A21.968Z', null, 'Eraser', 0.99, 200, '2023-06-12 10:17:45.318448', null, '2022-12-31 00:00:00.000000', false, false, 0, 'eraser'),
        (21, 5, 1, 'Organize your ideas and projects with confidence using this sturdy three-ring binder.', 'https://snivqgzdabtawqfgptyd.supabase.co/storage/v1/object/public/products/278068.jpg', null, 'Three-ring Binder', 14.99, 20, '2023-06-12 10:17:45.318448', null, '2022-12-31 00:00:00.000000', false, false, 0, 'three-ring-binder'),
        (22, 5, 1, 'Effortlessly add order to your documents with this convenient three-hole punch.', 'https://snivqgzdabtawqfgptyd.supabase.co/storage/v1/object/public/products/3holepunch.jpg', null, 'Three-hole-punch', 12.99, 10, '2023-06-12 10:17:45.318448', null, '2022-12-31 00:00:00.000000', false, false, 0, 'three-hole-punch'),
        (23, 5, 1, 'Capture your thoughts and unleash your creativity with this set of spiral notebooks.', 'https://snivqgzdabtawqfgptyd.supabase.co/storage/v1/object/public/products/notebook.jpg', null, 'Spiral Notebooks Set', 29.99, 30, '2023-06-12 10:17:45.318448', null, '2022-12-31 00:00:00.000000', false, false, 0, 'spiral-notebooks-set'),
        (24, 5, 1, 'Master your study sessions and create organized notes with this pack of index cards.', 'https://snivqgzdabtawqfgptyd.supabase.co/storage/v1/object/public/products/index.jpg', null, 'Index Cards Set', 4.99, 50, '2023-06-12 10:17:45.318448', null, '2022-12-31 00:00:00.000000', false, false, 0, 'index-cards-set'),
        (25, 5, 1, 'Keep your important papers in order and make a statement with this stylish set of folders.', 'https://snivqgzdabtawqfgptyd.supabase.co/storage/v1/object/public/products/folder.jpg?t=2023-06-12T10%3A13%3A03.437Z', null, 'Folders Set', 9.99, 20, '2023-06-12 10:17:45.318448', null, '2022-12-31 00:00:00.000000', false, false, 0, 'folders-set'),
        (26, 5, 1, 'Stick together your imaginative creations with this versatile and reliable glue.', 'https://snivqgzdabtawqfgptyd.supabase.co/storage/v1/object/public/products/glue.jpg', null, 'Glue', 2.99, 100, '2023-06-12 10:17:45.318448', null, '2022-12-31 00:00:00.000000', false, false, 0, 'glue'),
        (27, 5, 1, 'Measure your success with precision using this transparent and accurate ruler.', 'https://snivqgzdabtawqfgptyd.supabase.co/storage/v1/object/public/products/ruler-Wood.jpg', null, 'Ruler', 1.99, 200, '2023-06-12 10:17:45.318448', null, '2022-12-31 00:00:00.000000', false, false, 0, 'ruler'),
        (28, 5, 1, 'Unlock your creativity and effortlessly cut through possibilities with this set of sharp scissors.', 'https://snivqgzdabtawqfgptyd.supabase.co/storage/v1/object/public/products/scissors.jpg', null, 'Scissors Set', 8.99, 30, '2023-06-12 10:17:45.318448', null, '2022-12-31 00:00:00.000000', false, false, 0, 'scissors-set'),
        (29, 5, 1, 'Solve equations and conquer mathematical challenges with this feature-rich calculator.', 'https://snivqgzdabtawqfgptyd.supabase.co/storage/v1/object/public/products/calculator-300x300.jpg?t=2023-06-12T10%3A13%3A31.213Z', null, 'Calculator', 24.99, 10, '2023-06-12 10:17:45.318448', null, '2022-12-31 00:00:00.000000', false, false, 0, 'calculator'),
        (30, 5, 1, 'Take control of your busy life with this stylish and functional personal organizer.', 'https://snivqgzdabtawqfgptyd.supabase.co/storage/v1/object/public/products/planner.jpg', null, 'Personal Organizer', 34.99, 20, '2023-06-12 10:17:45.318448', null, '2022-12-31 00:00:00.000000', false, false, 0, 'personal-organizer'),
        (31, 5, 1, 'Embark on your creative journey with this spacious and comfortable backpack.', 'https://snivqgzdabtawqfgptyd.supabase.co/storage/v1/object/public/products/182699.jpg', null, 'Backpack', 69.99, 5, '2023-06-12 10:17:45.318448', null, '2022-12-31 00:00:00.000000', false, false, 0, 'backpack'),
        (12, 2, 9, 'The Forerunner 245 Music lets you use streaming music services ad-free, such as Deezer and Spotify, or playback your own audio that you store on the watch itself.', 'https://storage.googleapis.com/jamma-comments-332612.appspot.com/productmedia/-MpwJwuB9u1-7VBsuMOX.png', null, 'Garmin Forerunner 245', 19295, 100, '2023-06-09 09:41:09.923551', null, '2022-12-31 00:00:00.000000', false, false, 0, 'garmin-forerunner-245'),
